import React, { useState } from "react";
import { parse } from "react-papaparse";

const TestCSV =() => {
    const [highlighted, setHighlighted]= React.useState(false);

    return (
        <div>
            <h1 >Contact Import</h1>
            <div
             className={`p-6 my-2 mx-w-md border-2`}
             onDragEnter={() => {
                 setHighlighted(true);
             }}
             onDragLeave={() => {
                setHighlighted(false);
            }}

             onDragOver={(e) => {
                 e.preventDefault();

             }}
             onDrop={(e) => {
                e.preventDefault();
                setHighlighted(false);
                Array.from(e.dataTransfer.files).filter(
                    (files) => files.type === "text/csv"
                ).forEach((file) => {
                    console.log(file);    
                });
             }}
            > DROP HERE</div>
        </div>
    )
};
export default TestCSV;
